import {Formik} from "formik";

function FormSubscribe () {


    return(
        <div>
            <Formik>
                initialValues = {{
                email: " "
            }}
                validateOnBlur
                onSubmit={(values,{resetForm}) => {
                console.log(values);
                removeAfterBuy();
                resetForm();

            }}


            </Formik>


        </div>



    )
}

export default FormSubscribe;
